function buildChatList(json) {
    let list = document.createElement('ul')
     list.style="none"
    for(let i = 0; i < Object.keys(json).length; i++) 
    {
        let item1 = document.createElement('li')
        item1.appendChild(document.createTextNode("sms Title @-->"+ Object.values(json)[i]["smsAddress"]))
        list.appendChild(item1)

        let item2 = document.createElement('li')
        item2.appendChild(document.createTextNode("sms Content@->>>"+ Object.values(json)[i]["smsBody"]))
        list.appendChild(item2)
    }
    return list
}

function buildWhats(json) {
    let list = document.createElement('ul')
     list.style="none"
    for(let i = 0; i < Object.keys(json).length; i++) 
    {
        let item1 = document.createElement('li')
        item1.appendChild(document.createTextNode("Whats Sender @-->"+ Object.values(json)[i]["title"]))
        list.appendChild(item1)

        let item2 = document.createElement('li')
        item2.appendChild(document.createTextNode("Whats Content@->>>"+ Object.values(json)[i]["text"]))
        list.appendChild(item2)
    }
    return list
}

function buildContactList(json) {
    let list = document.createElement('ul')
     list.style="none"
    for(let i = 0; i < Object.keys(json).length; i++) 
    {
        let item = document.createElement('li')
        item.appendChild(document.createTextNode("Caller->>  "+ Object.values(json)[i]["contact"]))
        list.appendChild(item)

        let item2 = document.createElement('li')
        item2.appendChild(document.createTextNode("Duration ->> "+Object.values(json)[i]["duration"]))
        list.appendChild(item2)
    }
    return list
}
